import image1 from '../images/greenbook.png'
import image2 from 'https://i.pinimg.com/originals/81/e7/e7/81e7e729be0c451e5de818b522c6cf82.jpg'
const initialState = {
    movies: [
        {
            id: 1,
            name: "Green Book",
            image:image1,
        },
        {
            id: 2,
            name: "Venom",
            image:image2,
        }
    ]
};

function movies(state = initialState, action) {
    switch (action.type) {
        default:
            return state;
    }
}

export default movies;
